-- Copiando estrutura para trigger acapra.trg_avalia_resposta_form
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `trg_avalia_resposta_form` AFTER UPDATE ON `formulario_respostas` FOR EACH ROW BEGIN
  DECLARE v_faltando INT;

  SELECT COUNT(*) INTO v_faltando
  FROM formulario_perguntas fp
  WHERE COALESCE(fp.obrigatorio,1) = 1
    AND NOT EXISTS (
      SELECT 1
      FROM formulario_respostas fr
      WHERE fr.usuario_id = NEW.usuario_id
        AND fr.formulario_perguntas_id = fp.id
    );

  IF v_faltando = 0 THEN
    UPDATE adocao
       SET formulario_respondido = 1
     WHERE usuario_id = NEW.usuario_id
       AND LOWER(situacao) = 'pendente';
  END IF;
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

