DELIMITER //
CREATE TRIGGER `trg_capacidade_lar_pet` BEFORE INSERT ON `lar_temporario_pet` FOR EACH ROW BEGIN
  DECLARE v_limite     INT DEFAULT NULL;
  DECLARE v_ocupados   INT DEFAULT 0;
  DECLARE v_ja_ativo   INT DEFAULT 0;
  DECLARE v_is_active  TINYINT;

  /* Coerência: ativo=1 => data_saida deve ser NULL */
  IF COALESCE(NEW.ativo, 1) = 1 AND NEW.data_saida IS NOT NULL THEN
    SET NEW.data_saida = NULL;
  END IF;

  /* Se vier inativo e sem data_saida, preenche agora */
  IF COALESCE(NEW.ativo, 0) = 0 AND NEW.data_saida IS NULL THEN
    SET NEW.data_saida = NOW();
  END IF;

  /* O novo registro estará ativo de verdade? */
  SET v_is_active = (CASE
                       WHEN COALESCE(NEW.ativo, 1) = 1 AND NEW.data_saida IS NULL
                       THEN 1 ELSE 0
                     END);

  IF v_is_active = 1 THEN
    /* 1) Capacidade do lar (conta só ativos sem data de saída) */
    SELECT lt.limite_pets INTO v_limite
      FROM lar_temporario lt
     WHERE id = NEW.lar_temporario_id;

    SELECT COUNT(*) INTO v_ocupados
      FROM lar_temporario_pet
     WHERE lar_temporario_id = NEW.lar_temporario_id
       AND ativo = 1
       AND data_saida IS NULL;

    IF v_limite IS NOT NULL AND v_ocupados >= v_limite THEN
      SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Capacidade do lar temporário atingida.';
    END IF;

    /* 2) Exclusividade: o pet não pode estar em outro lar ativo */
    SELECT COUNT(*) INTO v_ja_ativo
      FROM lar_temporario_pet
     WHERE pet_id = NEW.pet_id
       AND ativo = 1
       AND data_saida IS NULL;

    IF v_ja_ativo > 0 THEN
      SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Já existe um lar temporário ativo para este pet.';
    END IF;
  END IF;
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

-- Copiando estrutura para trigger acapra.trg_capacidade_lar_pet_updt
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `trg_capacidade_lar_pet_updt` BEFORE UPDATE ON `lar_temporario_pet` FOR EACH ROW BEGIN
  DECLARE v_is_active_new     TINYINT;
  DECLARE v_was_active_old    TINYINT;
  DECLARE v_becoming_active   TINYINT;
  DECLARE v_becoming_inactive TINYINT;
  DECLARE v_limite   INT;
  DECLARE v_ocupados INT;
  DECLARE v_ja_ativo INT;

  /* 0) Intenção do update
        - Se o usuário ALTEROU a data_saida para um valor => encerrar (ativo=0)
        - Senão, se o usuário ALTEROU ativo 0->1 => reativar (data_saida=NULL)
        Obs.: comparamos NEW vs OLD para saber o que foi modificado.
  */
  IF NEW.data_saida IS NOT NULL
     AND (OLD.data_saida IS NULL OR NEW.data_saida <> OLD.data_saida) THEN
    -- intenção: encerrar hospedagem
    SET NEW.ativo = 0;

  ELSEIF NEW.ativo = 1 AND COALESCE(OLD.ativo,0) = 0 THEN
    -- intenção: reativar hospedagem
    SET NEW.data_saida = NULL;
  END IF;

  /* 1) Regras complementares:
        - Se ficou inativo e data_saida segue NULL, preenche agora
  */
  IF NEW.ativo = 0 AND NEW.data_saida IS NULL THEN
    SET NEW.data_saida = NOW();
  END IF;

  /* 2) Normalizações após coerência */
  SET v_is_active_new     = (CASE WHEN COALESCE(NEW.ativo,1) = 1 AND NEW.data_saida IS NULL THEN 1 ELSE 0 END);
  SET v_was_active_old    = (CASE WHEN COALESCE(OLD.ativo,0) = 1 AND OLD.data_saida IS NULL THEN 1 ELSE 0 END);
  SET v_becoming_active   = (CASE WHEN v_is_active_new = 1 AND v_was_active_old = 0 THEN 1 ELSE 0 END);
  SET v_becoming_inactive = (CASE WHEN v_is_active_new = 0 AND v_was_active_old = 1 THEN 1 ELSE 0 END);

  /* 3) Só se a NOVA linha ficar ativa aplicamos as validações */
  IF v_is_active_new = 1 THEN
    /* 3.1) Exclusividade: um pet não pode estar em dois lares ativos */
    SELECT COUNT(*) INTO v_ja_ativo
      FROM lar_temporario_pet
     WHERE pet_id = NEW.pet_id
       AND ativo = 1
       AND data_saida IS NULL
       AND id_lar_pet <> OLD.id_lar_pet;

    IF v_ja_ativo > 0 THEN
      SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Já existe um lar temporário ativo para este pet.';
    END IF;

    /* 3.2) Capacidade: ao ativar OU trocar de lar mantendo ativo */
    IF v_becoming_active = 1
       OR (v_was_active_old = 1 AND NEW.lar_temporario_id <> OLD.lar_temporario_id) THEN

      SELECT lt.limite_pets INTO v_limite
        FROM lar_temporario lt
       WHERE lt.id = NEW.lar_temporario_id;

      SELECT COUNT(*) INTO v_ocupados
        FROM lar_temporario_pet
       WHERE lar_temporario_id = NEW.lar_temporario_id
         AND ativo = 1
         AND data_saida IS NULL
         AND id_lar_pet <> OLD.id_lar_pet;

      IF v_limite IS NOT NULL AND v_ocupados >= v_limite THEN
        SIGNAL SQLSTATE '45000'
          SET MESSAGE_TEXT = 'Capacidade do lar temporário atingida.';
      END IF;
    END IF;
  END IF;
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

