-- Copiando estrutura para trigger acapra.trg_form_respondido_adocao
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `trg_form_respondido_adocao` BEFORE INSERT ON `adocao` FOR EACH ROW /*Verifica se o usuário respondeu todas as perguntas do formulário ao solicitar uma adoção.*/

BEGIN
  DECLARE v_total_perguntas INT DEFAULT 0;
  DECLARE v_total_resp      INT DEFAULT 0;

  -- total de perguntas do formulário
  SELECT COUNT(*) INTO v_total_perguntas
    FROM formulario_perguntas
    WHERE obrigatorio = 1
	 ;

  -- quantas perguntas este usuário já respondeu (distintas)
  SELECT COUNT(DISTINCT fr.formulario_perguntas_id) INTO v_total_resp
    FROM formulario_respostas fr
    JOIN formulario_perguntas fp ON fr.formulario_perguntas_id = fp.id
   WHERE fr.usuario_id = NEW.usuario_id
	AND fp.obrigatorio = 1;

  -- define o flag (1 se completou todas; senão 0)
  IF v_total_perguntas > 0 AND v_total_resp >= v_total_perguntas THEN
    SET NEW.formulario_respondido = 1;
  ELSE
    SET NEW.formulario_respondido = 0;
  END IF;
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

-- Copiando estrutura para trigger acapra.trg_form_respondido_updt
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `trg_form_respondido_updt` AFTER INSERT ON `formulario_respostas` FOR EACH ROW /*Verifica se o usuário respondeu todas as perguntas do formulário a cada nova pergunta que o mesmo responder.
Caso tenha respondido todas, faz um update na table "adocao", tornando o campo "formulario_respondido = 1".
Se não houverem adoções desse usuário, a trigger encerra*/

BEGIN
  DECLARE v_total_obrig INT DEFAULT 0;
  DECLARE v_resp_obrig  INT DEFAULT 0;

  /* total de perguntas obrigatórias */
  SELECT COUNT(*) INTO v_total_obrig
    FROM formulario_perguntas fp
   WHERE COALESCE(fp.obrigatorio, 1) = 1;

  /* quantas obrigatórias este usuário já respondeu (distintas) */
  SELECT COUNT(DISTINCT fr.formulario_perguntas_id) INTO v_resp_obrig
    FROM formulario_respostas fr
    JOIN formulario_perguntas fp
      ON fp.id = fr.formulario_perguntas_id
   WHERE fr.usuario_id = NEW.usuario_id
     AND COALESCE(fp.obrigatorio, 1) = 1;

  /* se atingiu o total de obrigatórias, marca as adoções pendentes como formulário respondido */
  IF v_total_obrig > 0 AND v_resp_obrig >= v_total_obrig THEN
    UPDATE adocao a
       SET a.formulario_respondido = 1
     WHERE a.usuario_id = NEW.usuario_id
       AND LOWER(a.situacao) = 'pendente';
    /* se não houver adoções, o UPDATE não encontra linhas e a trigger apenas finaliza */
  END IF;
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

-- Copiando estrutura para trigger acapra.trg_status_pet
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `trg_status_pet` AFTER UPDATE ON `adocao` FOR EACH ROW BEGIN
  DECLARE v_new VARCHAR(32);
  DECLARE v_old VARCHAR(32);

  -- Normaliza (caso a coluna seja VARCHAR; se for ENUM já vem padronizado)
  SET v_new = LOWER(NEW.situacao);
  SET v_old = LOWER(OLD.situacao);

  /* Caso 1: ADOÇÃO FOI APROVADA AGORA */
  IF v_new = 'aprovada' AND v_old <> 'aprovada' THEN
    -- 1.1 marca o pet como adotado
    UPDATE pet
       SET status = 'adotado'
     WHERE id = NEW.pet_id;

    -- 1.2 encerra lar temporário ativo(s) do pet
    UPDATE lar_temporario_pet
       SET data_saida = IFNULL(data_saida, NOW()),
           ativo      = 0
     WHERE pet_id = NEW.pet_id
       AND ativo = 1;

  /* Caso 2: ADOÇÃO DEIXOU DE SER APROVADA (voltou a pendente/rejeitada) */
  ELSEIF v_old = 'aprovada' AND v_new IN ('pendente','rejeitada') THEN
    -- 2.1 marca o pet como disponível
    UPDATE pet
       SET status = 'disponivel'
     WHERE id = NEW.pet_id;

    -- 2.2 reabre o ÚLTIMO lar temporário do pet (se existir)
    -- (usa ORDER BY + LIMIT 1 para pegar o mais recente)
    UPDATE lar_temporario_pet
       SET ativo = 1,
           data_saida = NULL
     WHERE pet_id = NEW.pet_id
       AND ativo = 0
     ORDER BY COALESCE(data_saida, '1000-01-01'), COALESCE(data_entrada, '1000-01-01') DESC
     LIMIT 1;
  END IF;
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

-- Removendo tabela temporária e criando a estrutura VIEW final
DROP TABLE IF EXISTS `vw_adocao_usuario_pet`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_adocao_usuario_pet` AS select `a`.`id` AS `id_adocao`,`u`.`nome` AS `usuario`,`p`.`nome` AS `pet`,`a`.`situacao` AS `situacao`,`a`.`solicitado_em` AS `solicitado_em`,`a`.`aprovado_em` AS `aprovado_em`,`a`.`formulario_respondido` AS `formulario_respondido`,row_number() OVER (PARTITION BY `a`.`pet_id` ORDER BY `a`.`solicitado_em`,`a`.`id` )  AS `posicao_na_fila` from ((`adocao` `a` join `usuario` `u` on((`u`.`id` = `a`.`usuario_id`))) join `pet` `p` on((`p`.`id` = `a`.`pet_id`)))
;

-- Removendo tabela temporária e criando a estrutura VIEW final
DROP TABLE IF EXISTS `vw_formulario_respondido_usuario`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_formulario_respondido_usuario` AS select `u`.`id` AS `id`,`u`.`nome` AS `nome`,`u`.`email` AS `email`,`u`.`celular` AS `celular`,`u`.`telefone` AS `telefone`,`u`.`senha` AS `senha`,`u`.`tipo_usuario` AS `tipo_usuario`,`u`.`ativo` AS `ativo`,`u`.`cep` AS `cep`,`u`.`cidade` AS `cidade`,`u`.`estado` AS `estado`,`u`.`bairro` AS `bairro`,`u`.`endereco` AS `endereco`,`u`.`complemento` AS `complemento`,`u`.`numero` AS `numero` from `usuario` `u` where ((select count(`fp`.`id`) from `formulario_perguntas` `fp`) = (select count(`fr`.`id`) from `formulario_respostas` `fr` where (`fr`.`usuario_id` = `u`.`id`)))
;

-- Removendo tabela temporária e criando a estrutura VIEW final
DROP TABLE IF EXISTS `vw_lar_pet`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_lar_pet` AS select `ltp`.`id_lar_pet` AS `id_lar_pet`,`lt`.`nome` AS `lar_temporario`,`p`.`nome` AS `pet`,concat(`lt`.`cidade`,' - ',`lt`.`estado`) AS `cidade`,concat(`lt`.`endereco`,', ',`lt`.`bairro`) AS `endereco` from ((`lar_temporario_pet` `ltp` join `lar_temporario` `lt` on((`ltp`.`lar_temporario_id` = `lt`.`id`))) join `pet` `p` on((`p`.`id` = `ltp`.`pet_id`))) group by `ltp`.`id_lar_pet`
;

-- Removendo tabela temporária e criando a estrutura VIEW final
DROP TABLE IF EXISTS `vw_ocupacao_lar`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_ocupacao_lar` AS select distinct `lt`.`id` AS `id_lar_temp`,`lt`.`nome` AS `lar_temp`,(select count(0) from `lar_temporario_pet` where ((`lar_temporario_pet`.`lar_temporario_id` = `lt`.`id`) and (`lar_temporario_pet`.`ativo` = 1) and (`lar_temporario_pet`.`data_saida` is null))) AS `ocupacao_atual`,`lt`.`limite_pets` AS `ocupacao_max` from ((`lar_temporario_pet` `ltp` join `lar_temporario` `lt` on((`ltp`.`lar_temporario_id` = `lt`.`id`))) join `pet` `p` on((`p`.`id` = `ltp`.`pet_id`))) order by `lt`.`id`
;

-- Removendo tabela temporária e criando a estrutura VIEW final
DROP TABLE IF EXISTS `vw_pets_resgatados`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_pets_resgatados` AS select `pet`.`id` AS `id`,`pet`.`nome` AS `nome`,`pet`.`descricao` AS `descricao`,`pet`.`sexo` AS `sexo`,`pet`.`raca` AS `raca`,`pet`.`porte` AS `porte`,`pet`.`data_nascimento` AS `data_nascimento`,`pet`.`pelagem` AS `pelagem`,`pet`.`castrado` AS `castrado`,`pet`.`vacinado` AS `vacinado`,`pet`.`status` AS `status` from `pet` where (`pet`.`status` = 'resgatado')
;

-- Removendo tabela temporária e criando a estrutura VIEW final
DROP TABLE IF EXISTS `vw_pet_sem_lar`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_pet_sem_lar` AS select `p`.`id` AS `pet_id`,`p`.`nome` AS `nome`,`p`.`sexo` AS `sexo`,`p`.`porte` AS `porte` from `pet` `p` where ((lower(`p`.`status`) = 'disponivel') and exists(select 1 from `lar_temporario_pet` `ltp` where ((`ltp`.`pet_id` = `p`.`id`) and (`ltp`.`ativo` = 1) and (`ltp`.`data_saida` is null))) is false)
;

-- Removendo tabela temporária e criando a estrutura VIEW final
DROP TABLE IF EXISTS `vw_resposta_usuario`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_resposta_usuario` AS select `u`.`id` AS `id`,`u`.`nome` AS `usuario`,`fp`.`pergunta` AS `pergunta`,`fr`.`resposta` AS `resposta` from ((`formulario_respostas` `fr` join `formulario_perguntas` `fp` on((`fp`.`id` = `fr`.`formulario_perguntas_id`))) join `usuario` `u` on((`u`.`id` = `fr`.`usuario_id`)))
;

